import React, { useState, useRef } from 'react'
import 'photoswipe/dist/photoswipe.css'
import 'photoswipe/dist/default-skin/default-skin.css'

import PhotoswipeUIDefault from 'photoswipe/dist/photoswipe-ui-default'
import { CustomGallery, Item, DefaultLayout } from 'react-photoswipe-gallery'
import { Button } from '@chakra-ui/button'
import { Box, Flex } from '@chakra-ui/layout'
import NavBar from '../components/navbar'
import { DeleteIcon } from '@chakra-ui/icons'
export const TestPage = () => {
  

  return (
   <NavBar>
     <Galary/>
   </NavBar>
  )
}
const Galary=()=>{
  const layoutRef = useRef()
  const [images,setImages]=useState(["https://placekitten.com/1024/768?image=1","https://placekitten.com/1024/768?image=2"])

  return(
    <Flex flexDirection="row">
    <CustomGallery layoutRef={layoutRef} ui={PhotoswipeUIDefault}>

      {images.map((image)=>{
         return(
          <Item
          original={image}
          thumbnail={image}
          width="1024"
          height="768"
        >
          {({ ref, open }) => (
           <>
            <img ref={ref} onClick={open} src={image}  width="200px" height="200px"/>
            <Button marginLeft="-5"><DeleteIcon/></Button>
           </>
          )}
        </Item>
         )
      })}
   
    </CustomGallery>

    <DefaultLayout
      shareButton={false}
      fullscreenButton={true}
      zoomButton={true}
      ref={layoutRef}
    />
    </Flex>
  )
}
